const canvas = document.querySelector('canvas');
const gl = canvas.getContext("webgl2");
const program = gl.createProgram();

shader(gl.VERTEX_SHADER, `#version 300 es
    precision lowp float;
    precision lowp int;

    const vec2 positions[4] = vec2[4](
        vec2(-1.0,  1.0),
        vec2( 1.0,  1.0),
        vec2(-1.0, -1.0),
        vec2( 1.0, -1.0)
    );

    const vec2 uvs[4] = vec2[4](
        vec2(0.0, 1.0),
        vec2(1.0, 1.0),
        vec2(0.0, 0.0),
        vec2(1.0, 0.0)
    );

    out vec2 uv;

    uniform vec2 s;
    uniform vec2 p;
    uniform int r;
    uniform bool fx;
    uniform bool fy;
    uniform vec2 tp;

    void main() {

        vec2 pos = positions[gl_VertexID];
        uv = uvs[gl_VertexID];

        // Apply transformations for rotation and flipping
        pos.y = -pos.y;
        pos *= 0.1;
        if (r == 1) {
            pos = vec2(pos.y, -pos.x);
        } else if (r == 2) {
            pos = vec2(-pos.x, -pos.y);
        } else if (r == 3) {
            pos = vec2(-pos.y, pos.x);
        }
        if (fx) {
            pos.x = -pos.x;
        }
        if (fy) {
            pos.y = -pos.y;
        }
        
        // Scale and translate
        pos = pos * s;
        pos = pos + vec2(p.x * 0.2, p.y * 0.2);
        gl_Position = vec4(pos, 0.0, 1.0);

        // Tile UV calculation
        vec2 tile = vec2(16.0, 16.0) / 256.0;
        uv = (tp * tile) + (uv * tile);
    }
`);

shader(gl.FRAGMENT_SHADER, `#version 300 es
    precision lowp float;
    precision lowp int;

    in vec2 uv;
    out vec4 fragColor;

    uniform sampler2D ts;
    uniform float w;

    int t() {
        float tx = uv.x * w;
        return (int(texture(ts, vec2(float(int(tx / 8.0)) / (w / 8.0), uv.y)).r * 255.0) >> (7 - int(tx) & 7)) & 1;
    }

    void main() {
        fragColor = vec4(vec3(t()), 1.0);
    }
`);

function shader(type, source) {
    const id = gl.createShader(type);
    gl.shaderSource(id, source);
    gl.compileShader(id);
    if (!gl.getShaderParameter(id, gl.COMPILE_STATUS)) {
        alert("Error compiling " + type + " shader: " + gl.getShaderInfoLog(id));
    }
    gl.attachShader(program, id);
}

gl.linkProgram(program);

if (!gl.getProgramParameter(program, gl.LINK_STATUS)) {
    alert("Error linking program: " + gl.getProgramInfoLog(program));
}

gl.useProgram(program);

