const tm = Math.sqrt(tileset.length);
const t = gl.createTexture();
const tb = new Uint8Array(tileset.length / 8);

for (let i = 0; i < tileset.length; i += 8) {
    let packedByte = 0;
    for (let j = 0; j < 8; j++) {
        if (i + j < tileset.length) {
            packedByte |= (tileset[i + j] > 0 ? 1 : 0) << (7 - j);
        }
    }
    tb[i / 8] = packedByte;
}

gl.bindTexture(gl.TEXTURE_2D, t);
gl.pixelStorei(gl.UNPACK_ALIGNMENT, 1);
gl.texImage2D(gl.TEXTURE_2D, 0, gl.LUMINANCE, Math.ceil(tm / 8), tm, 0, gl.LUMINANCE, gl.UNSIGNED_BYTE, tb);
gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_S, gl.CLAMP_TO_EDGE);
gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_WRAP_T, gl.CLAMP_TO_EDGE);
gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MIN_FILTER, gl.NEAREST);
gl.texParameteri(gl.TEXTURE_2D, gl.TEXTURE_MAG_FILTER, gl.NEAREST);

gl.activeTexture(gl.TEXTURE0);
gl.bindTexture(gl.TEXTURE_2D, t);
gl.uniform1f(gl.getUniformLocation(program, "w"), tm);
gl.uniform1i(gl.getUniformLocation(program, "ts"), 0);

class Entity {
    fx = false;
    fy = false;
    r  = 0;
    constructor(id, x, y, tx, ty) {
        this.id = id;
        this.x  = x;
        this.y  = y;
        this.tx = tx;
        this.ty = ty;
    }
}

var cubes = [];

for (var i = -3; i < 5; i++) {
    cubes.push(new Entity(i + 3, i * 1.2, 0, i + 3, 0));
}

const r     = gl.getUniformLocation(program, "r");
const fx    = gl.getUniformLocation(program, "fx");
const fy    = gl.getUniformLocation(program, "fy");
const p     = gl.getUniformLocation(program, "p");
const tp    = gl.getUniformLocation(program, "tp");
const s     = gl.getUniformLocation(program, "s");

function draw(now) {
    gl.clearColor(0.0, 0.0, 0.0, 1.0);
    gl.clear(gl.COLOR_BUFFER_BIT);

    for (let i = 0; i < cubes.length; i++) {
        let cube = cubes[i];

        gl.uniform2f(tp, cube.tx, cube.ty);
        gl.uniform1i(r, cube.r);
        gl.uniform1i(fx, cube.fx ? 1 : 0);
        gl.uniform1i(fy, cube.fy ? 1 : 0);
        gl.uniform2f(p, cube.x, cube.y);

        gl.drawArrays(gl.TRIANGLE_STRIP, 0, 4);
    }
}

window.addEventListener('click', () => {
    /* Fullscreen logic if needed */
});

window.addEventListener("resize", resize);
window.addEventListener("fullscreenchange", resize);

function resize() {
    canvas.width = window.innerWidth * window.devicePixelRatio;
    canvas.height = window.innerHeight * window.devicePixelRatio;
    window.ratio = window.innerWidth / window.innerHeight;
    if (window.ratio > 1) {
        gl.uniform2f(s, 1.0 / window.ratio, 1.0);
    } else {
        gl.uniform2f(s, 1.0, window.ratio);
    }
    gl.viewport(0, 0, canvas.width, canvas.height);
    document.title = "R: " + window.devicePixelRatio + ", PR: " + window.ratio;
    requestAnimationFrame(draw);
}

document.addEventListener('keydown', (event) => {
    var cube = cubes[0];
    switch (event.key) {
        case 'r':
            cube.r = (cube.r + 1) % 4;
            break;
        case 'h':
            cube.fx = !cube.fx;
            break;
        case 'v':
            cube.fy = !cube.fy;
            break;
        case ' ':
            for (var i = cubes.length - 1; i >= 0; i--) {
                cubes[i].ty = cubes[i].ty == 1 ? 2 : 1;
            }
            break;
    }
    requestAnimationFrame(draw);
});

function random(min, max) {
  return Math.floor(Math.random() * (max - min + 1) + min);
}

resize();
requestAnimationFrame(draw);
